          if (text == '')
            $('#TWMhelpBox').html('');
          else
            $('#TWMhelpBox').html('<table><tr><td><img src="' + TWM.images.info + '"></td><td style="vertical-align:middle; width:600px">' + text + '</td><td><img src="' + TWM.images.info + '"></td></tr></table>');
